Let's design a computational model to predict responder acceptance behavior in this economic game.

**Step 1: Key Psychological Mechanisms**

Responders are likely to consider several factors when deciding whether to accept or reject a proposal:

* **Fairness:**  Responders might have an internal sense of fairness, comparing the proposed split to their contribution relative to the opponent's contribution.  A significant deviation from perceived fairness could lead to rejection.

* **Self-Interest:** Responders will naturally prioritize maximizing their own payoff.  A higher proposed share for themselves will increase the likelihood of acceptance.

* **Relative Contribution:** The ratio of the responder's tokens to the opponent's tokens ("token_self" / "token_opp") strongly influences the perceived fairness of the split.  A disproportionately large contribution might warrant a more demanding acceptance threshold.

* **Risk Aversion:**  Responders may exhibit risk aversion. The riskier the proposal (i.e., offers close to zero), the more likely the responder is to reject it, even if the expected value is positive. This could be modeled as a utility function that is concave for money.


**Step 2: Interaction of Mechanisms**

These mechanisms interact in a complex way. For instance, a responder with a strong sense of fairness might accept a slightly unfair proposal if their self-interest is also significantly served. Conversely, a responder highly focused on self-interest might reject even a slightly less-than-fair but low-paying proposal.  Relative contribution weights fairness perception.

**Step 3: Mathematical Form**

A weighted linear utility model combined with a logistic function to predict binary choice could capture these interactions well.  The utility will include terms representing fairness, self-interest and risk aversion.

**Step 4: Parameters**

We'll need parameters to weigh the importance of each factor:

* Fairness weight
* Self-interest weight
* Risk aversion parameter


**Step 5: Mapping to Observable Behavior**

The model will take the relevant data as input (token_self, token_opp, split_self, combined_earning) and use the learned parameters to calculate a utility score for accepting the proposal. A logistic function will transform this utility into a probability of acceptance.

<MODEL>
U =  w_fairness * (split_self / combined_earning - (token_self / (token_self + token_opp))) + w_self_interest * (split_self) - w_risk_aversion * exp(-split_self)

P(accept) = 1 / (1 + exp(-U))
</MODEL>

